DROP TABLE IF EXISTS `socio`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `socio` (
  `idsocio` varchar(25) NOT NULL,
  `nombres` varchar(45) DEFAULT NULL,
  `apellido_paterno` varchar(45) DEFAULT NULL,
  `apellido_materno` varchar(45) DEFAULT NULL,
  `documento` varchar(45) DEFAULT NULL,
  `correo` varchar(45) DEFAULT NULL,
  `fotoBytes` longblob,
  `huellaBytes` longblob,
  `firmaBytes` longblob,
  `requisito_asociarseBytes` longblob,
  `codigo_barra` longblob,
  `codigo_qr` longblob,
  `idestado` int(11) DEFAULT NULL,
  `idusuario` int(11) NOT NULL,
  `idtipoDocumento` int(11) NOT NULL,
  `idPais` int(11) NOT NULL,
  `idubigeo` int(11) NOT NULL,
  `idtrabajador` varchar(25) NOT NULL,
  `motivo_actualizacion` varchar(200) DEFAULT NULL,
  `huellaFileName` varchar(200) DEFAULT NULL,
  `huellaContentType` varchar(45) DEFAULT NULL,
  `requisito_asociarseFileName` varchar(200) DEFAULT NULL,
  `requisito_asociarseContentType` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`idsocio`),
  KEY `fk_socio_usuario1_idx` (`idusuario`),
  KEY `fk_socio_tipoDocumento1_idx` (`idtipoDocumento`),
  KEY `fk_socio_Pais1_idx` (`idPais`),
  KEY `fk_socio_ubigeo` (`idubigeo`),
  KEY `fk_socio_trabajador1_idx` (`idtrabajador`),
  CONSTRAINT `fk_socio_Pais1` FOREIGN KEY (`idPais`) REFERENCES `pais` (`idPais`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_socio_tipoDocumento1` FOREIGN KEY (`idtipoDocumento`) REFERENCES `tipodocumento` (`idtipoDocumento`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_socio_trabajador1` FOREIGN KEY (`idtrabajador`) REFERENCES `trabajador` (`idtrabajador`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_socio_ubigeo1` FOREIGN KEY (`idubigeo`) REFERENCES `ubigeo` (`idubigeo`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_socio_usuario1` FOREIGN KEY (`idusuario`) REFERENCES `usuario` (`idusuario`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
